           RPayPFRegister.FileName :
           RPayPFRegister.FilePath + #FilePathDelimiter + RPayPFRegister.FileName;
}

#WinAPI
void navigate()
{
    FileNameOpen selectedFile;
    container conFilter = ['Файлы XML (*.xml)', '*.xml'];

    str filePath2navigate;
    ;

    filePath2navigate = conpeek(filenamesplit(RPayPFRegister.FileName), 1);
    filePath2navigate = substr(filePath2navigate, 1, strlen(filePath2navigate) - 1);

    if (RPayPFRegister.FileName && Winapi::fileExists_RU(filePath2navigate))
    {
        if (Winapi::getFileAttributes(filePath2navigate) & #FILE_ATTRIBUTE_DIRECTORY)
        {
            selectedFile = Winapi::getOpenFileName( element.hWnd(), conFilter, filePath2navigate, '');
            if (selectedFile)
            {
                webBrowser.Navigate(selectedFile);
            }
        }
        else
        {
            webBrowser.navigate(element.getFileName());
        }
    }
    else
    {
        webBrowser.navigate('about:blank');
    }
}

void updateBatchQuery()
{
    QueryBuildRange qbrOrig, qbrCorr;
    ReportPeriod_RU lastPeriod;

    qbrOrig = SysQuery::findOrCreateRange(RPayPFBatchesOriginal_ds.query().dataSourceTable(tablenum(RPayPFBatches)), fieldnum(RPayPFBatches, Period));
    qbrCorr = SysQuery::findOrCreateRange(RPayPFBatchesCorrection_ds.query().dataSourceTable(tablenum(RPayPFBatches)), fieldnum(RPayPFBatches, Period));

    lastPeriod = RPayReportRSV1_2014::getLastQuarterPeriodOrig(RPayPFRegister);

    qbrOrig.value(SysQuery::range(dateStartQtr(lastPeriod), maxDate()));
    qbrOrig.status(RangeStatus::Locked);

    qbrCorr.value(SysQuery::range(datenull(), dateStartQtr(lastPeriod) - 1));
    qbrCorr.status(RangeStatus::Locked);
}

void updateDesign()
{
    boolean         allowEditCorr, allowEditCorrNum, canCreateRegister;

    if (!RPayPFRegister.RecId && RPayPFRegister.Year)
    {
        allowEditCorr = RPayPFRegister::existsPeriod(RPayPFRegister.Year, RPayPFRegister.Period);

        RPayPFRegister_ds.object(fieldnum(RPayPFRegister, CorrType)).allowEdit(allowEditCorr);

        if (allowEditCorr && RPayPFRegister.CorrType != RPayPFCorrectionType::None)
        {
            allowEditCorrNum = true;
        }
        else
        {
            allowEditCorrNum = false;
        }

        RPayPFRegister_ds.object(fieldnum(RPayPFRegister, CorrNum)).allowEdit(allowEditCorrNum);
        RPayPFRegister_ds.object(fieldnum(RPayPFRegister, CorrDate)).allowEdit(allowEditCorrNum);
    }

    if (RPayPFRegister.RecId)
    {
        canCreateRegister = !RPayPFRegister.existsLaterRegister();
    }
    else
    {
        canCreateRegister = true;
    }

    RPayPFRegister_ds.allowEdit(canCreateRegister);
    RPayPFRegister_ds.allowDelete(canCreateRegister);
    RPayPFRegisterGenerator.enabled(canCreateRegister);

    TabPageBatches.visible(!RPayPFRegister.isCorrRegister());
}

#define.Year2014(01\01\2014)
void updateDesignAddAmounts()
{
    boolean isLastRegister = !RPayPFRegister.existsLaterRegister();
    void checkAddAmount(RPayPFRegisterAdd _rPayPFRegisterAdd, FormDataSource _formDataSource)
    {
        boolean allowEditPFAcc = true,
                allowEditPFAdd3 = true;

        if (_rPayPFRegisterAdd.Period)
        {
            if (_rPayPFRegisterAdd.Period < #Year2014)
            {
                allowEditPFAcc = true;
                allowEditPFAdd3 = false;
            }
            else
            {
                allowEditPFAcc = false;
                allowEditPFAdd3 = true;
            }
        }

        _formDataSource.object(fieldnum(RPayPFRegisterAdd, PFAcc)).allowEdit(allowEditPFAcc);
        _formDataSource.object(fieldnum(RPayPFRegisterAdd, PFAdd3)).allowEdit(allowEditPFAdd3);
    }

    checkAddAmount(RPayPFRegisterAddAmounts, RPayPFRegisterAddAmounts_DS);
    checkAddAmount(RPayPFRegisterAddPayments, RPayPFRegisterAddPayments_DS);

    RPayPFRegisterAddAmounts_DS.allowCreate(isLastRegister);
    RPayPFRegisterAddAmounts_DS.allowEdit(
        isLastRegister &&
        RPayPFRegisterAddAmounts.RegisterRefRecId == RPayPFRegister.RecId);
    RPayPFRegisterAddAmounts_DS.allowDelete(
        isLastRegister &&
        RPayPFRegisterAddAmounts.RegisterRefRecId == RPayPFRegister.RecId);

    RPayPFRegisterAddPayments_DS.allowCreate(isLastRegister);
    RPayPFRegisterAddPayments_DS.allowEdit(
        isLastRegister &&
        RPayPFRegisterAddPayments.RegisterRefRecId == RPayPFRegister.RecId);
    RPayPFRegisterAddPayments_DS.allowDelete(
        isLastRegister &&
        RPayPFRegisterAddPayments.RegisterRefRecId == RPayPFRegister.RecId);
}

void updateQueryAddAmounts(Query _query)
{
    QueryBuildRange qbr;
    QueryBuildDataSource qbds, abdsRPayPFRegister;

    qbds = _query.dataSourceTable((tablenum(RPayPFRegisterAdd)));
    abdsRPayPFRegister = SysQuery::findOrCreateDataSource(_query, tablenum(RPayPFRegister), tablenum(RPayPFRegisterAdd));
    abdsRPayPFRegister.addLink(fieldnum(RPayPFRegisterAdd, RegisterRefRecId), fieldnum(RPayPFRegister, RecId));

    qbr = findOrCreateRange_W(abdsRPayPFRegister, fieldnum(RPayPFRegister, Year));
    qbr.value(queryvalue(RPayPFRegister.Year));
    qbr.status(RangeStatus::Locked);

    qbr = findOrCreateRange_W(abdsRPayPFRegister, fieldnum(RPayPFRegister, Period));
    qbr.value(queryvalue(RPayPFRegister.Period));
    qbr.status(RangeStatus::Locked);

    qbr = findOrCreateRange_W(abdsRPayPFRegister, fieldnum(RPayPFRegister, CorrNum));
    qbr.value(SysQuery::range(SysQuery::valueUnlimited(), RPayPFRegister.CorrNum));
    qbr.status(RangeStatus::Locked);
}

