public boolean validate()
{
    boolean ret;

    ret = super();
    if (ret)
    {
        if (RPayPFRegisterAddPayments.Type == RPayPFAddPremiumType::AddAmounts)
        {
            ret = checkFailed(strfmt("@SYP4881383", enum2str(RPayPFAddPremiumType::AddAmounts)));
        }
    }

    return ret;
}

